import React, { useState } from 'react';
import { Collapse, Button, CardBody, Card } from 'reactstrap';
import './Demographic.css';

class Demographic extends Component {
  constructor(props) {
    super(props);
    this.state = {
      collapse: false,
      dropDownOpen: false,
      demographic: 'All Demographics',
    }

  }
  toggle = () => {
    this.setState({
      collapse: !this.state.collapse,
    })
  };

  render() {
    const { collapse, dropDownOpen, demographic } = this.state;
    return (
      <div className="demographic-container">
        <Button color="primary" onClick={toggle} style={{ fontSize: '20px', height: '45px', marginBottom: '1rem', width: '400px', textAlign: 'left' }}>
            Demographics 
            {collapse ? <p className="plus-button">-</p> : <p className="plus-button">+</p> }

          </Button>
        <h5>Current filters: {demographic}</h5>
        <Collapse
          isOpen={collapse}
        >
          <Card className = "Card">
            <CardBody className="Subcategory">
              Anim pariatur cliche reprehenderit,
             enim eiusmod high life accusamus terry richardson ad squid. Nihil
             anim keffiyeh helvetica, craft beer labore wes anderson cred
             nesciunt sapiente ea proident.
            </CardBody>
          </Card>
        </Collapse>
      </div>
    );
  }

}

export default Demographics;
